import React from 'react';
import ButtonGroup from 'antd/lib/button/button-group';
import { Button, Tag } from 'antd';
export const Columns = () => [
  {
    title: 'Nombre',
    dataIndex: 'name',
    key: 'name',
    sorter: true
  },
  {
    title: 'Usuario',
    dataIndex: 'username',
    key: 'username',
    sorter: true
  },
  {
    title: 'Empleado',
    dataIndex: 'admin',
    key: 'admin',
    render: (data) => (<span>{data == true ? <Tag color="green">Es Empleado</Tag> : <Tag color="red">No es Empleado</Tag>}</span>)
  },
  {
    title: 'Acciones',
    dataIndex: 'action',
    key: 'action',
    render: (d, text) => <span><ButtonGroup><Button type="primary">Modificar</Button><Button type="danger">Borrar</Button></ButtonGroup></span>
  }
]

export default Columns;
